import React from 'react';

const BrowseResumes = () => {
  return (
    <div className="p-4">
      <h2>Browse Resumes</h2>
      {/* Simulate a list of resumes */}
      <div>Resume 1</div>
      <div>Resume 2</div>
      <div>Resume 3</div>
    </div>
  );
};

export default BrowseResumes;
